import React from 'react';

const BucketList = (props) => {
  const my_lists = props.list;
  return(
      <div>
          {
            my_lists.map((list, index) => {
              return (<div key={index}>{list}</div>)
            })
          }
      </div>
      
  );
}

export default BucketList;
